	quantize := func(input []float32) []int8 {
		// Find max absolute value
		var maxAbs float32
		for _, v := range input {
			abs := v
			if abs < 0 {
				abs = -abs
			}
			if abs > maxAbs {
				maxAbs = abs
			}
		}

		// Quantize with scaling factor
		quantized := make([]int8, len(input))
		scale := float32(127.0)
		if maxAbs > 0 {
			scale = 127.0 / maxAbs
		}

		for i, v := range input {
			scaled := v * scale
			scaled = float32(math.Round(float64(scaled)))
			if scaled > 127 {
				quantized[i] = 127
			} else if scaled < -128 {
				quantized[i] = -128
			} else {
				quantized[i] = int8(scaled)
			}
		}
		return quantized
	}

